    [],nt"num_tags": 0,nt"name": "temperature-salinity-and-other-variables-collected-from-discrete-sample-and-profile-observation995ff",nt"isopen":
    false,nt"url": null,nt"notes": "NCEI Accession 0143947 includes discrete
    sample and profile data collected from AURORA AUSTRALIS in the Indian Ocean, South
    Pacific Ocean and Southern Oceans (> 60 degrees South) from 2011-01-04 to 2011-02-06.
    These data include DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, Potential temperature
    (theta), SALINITY, WATER TEMPERATURE, nitrate + nitrite content (concentration),
    phosphate and silicate. The instruments used to collect these data include CTD and
    bottle.nnThese data were collected by Mark Rosenberg of Antarctic Climate & Ecosystems
    Cooperative Research Centre and Stephen R. Rintoul of Commonwealth Scientific and
    Industrial Research Organization as part of the CLIVAR_SR03_2011 data set. CDIAC
    associated the following cruise ID(s) with this data set: AU1121 and CLIVAR_SR03_2011nnThe
    International CLIVAR Global Ocean Carbon and Repeat Hydrography Program carries
    out a systematic and global re-occupation of select WOCE/JGOFS hydrographic sections
    to quantify changes in storage and transport of heat, fresh water, carbon dioxide
